import Link from "next/link";
import Navbar from "../components/Navbar";

const index = () => (
  <div>
    <Navbar />
    <h1>Index Page</h1>
    <Link href="/about">
      <a>About</a>
    </Link>
    <br></br>
    <Link href="/contact">
      <a>Contact</a>
    </Link>
  </div>
);

export default index;
